	(95659568,'Content Examples   Content Management Made Easy    To help get you started with TYPO3, we’ve included usage examples of the core content elements that have made TYPO3 so popular.  These examples illustrate how - straight out-of-the-box - TYPO3 delivers a vast amount of freedom to content editors. Unlike more static content management systems, TYPO3 content management is highly element-based and granular. Click on any of the links in the secondary navigation, to the right, to see examples of each core content element.  Feel free to log into the TYPO3 backend to see how easily these content elements (and pages) can be created, deleted, and modified!          Text         \n                                        Rich Text\n                                       TYPO3 ships with the CKEditoras there sophisticated built-in rich text editor (RTE).    \n                                \n                                        See examples\n                                    \n                                     \n                                        Headers\n                                       Predefined header layouts for editors to utilize across the site.    \n                                \n                                        See examples\n                                    \n                                     \n                                        Bullet List\n                                       Easy to maintain definition, ordered and unordered lists.    \n                                \n                                        See examples\n                                    \n                                     \n                                        Text with Teaser\n                                         \n                                \n                                        See examples\n                                    \n                                     \n                                        Text and Icon