	(146845407,'Features   A single TYPO3 CMS installation can easily power hundreds of websites in many dozens of languages. Need more functionality? No problem! More than 1,500 open source extensions are available via Packagist and TYPO3 Extension Repository (TER).                                \n                                \n\n    \n            \n                                    Multisite\n                                \n        \n\n\n                              A single TYPO3 CMS installation can power multiple sites, efficiently sharing configuration, templates, branding, and content where needed. Point multiple domains to different entry points of your TYPO3 multisite installation.        \n                                \n\n    \n            \n                                    Multilingual\n                                \n        \n\n\n                              Deploy your content (or localised copies of your website in a multisite installation) in 56 languages. TYPO3 CMS websites and multisite installations support a variety of translation and localisation models and workflows.        \n                                \n\n    \n            \n                                    Any data, any source\n                                \n        \n\n\n                              The TYPO3 CMS file system abstraction layer can use and combine any number of file storage systems and locations while remaining completely transparent to editors. Existing file service integrations include Akamai, Alfresco, SixOMC, Cumulus, QBank DAM, Dropbox, Magento, Bynder, and Amazon S3.        \n                                \n\n    \n            \n                                    Mobile apps, responsive sites\n                                \n        \n\n\n                              Use TYPO3 CMS as the content management, business logic, and content provider for native mobile applications and front-end frameworks, as well as fully-responsive websites for website visitors and admins.        \n                                \n\n    \n            \n                                    Content history and auditing\n                                \n        \n\n\n                              TYPO3 CMS keeps a full, unlimited, auditable history of content publication and revision. Browse all changes in a visual data comparison via “diff” and selectively undo, or even undelete!        \n                                \n\n    \n            \n                                    On-page Search Engine Optimization (SEO)\n                                \n        \n\n\n                              A major part of getting on-page SEO right is consistency. With TYPO3 you can optimize for search engines on the go as you create individual pages with features like URL structure, page titles, and headers. It also allows you to quickly add your own meta description and meta tags.              Full Responsive Backend    The administration interface, called TYPO3 Backend, can be managed from any modern web browser, including tablets and smart phones the same way. Publishing a small change on-the-go or working with tablet devices to add content has never been easier.                                Runs everywhere    You can install TYPO3 by downloading  with or without composer . Putting it on a web server or on a cloud service like Microsoft Azure or Amazon AWS is simple - due to proper separation of content, configuration and other assets like caches and temporary files. Use any database you like MySQL/MariaDB, postgreSQL, SQL Server or SQLite - due to the underlying database abstraction.   Read TYPO3 Install Guide            Reliable Upgrade Paths    From its inception TYPO3 has emphasized the importance of stable APIs and full backwards-compatibility.  The TYPO3 core team follows a regular release schedule and take great care to ensure easy, non-breaking updates.   TYPO3 CMS Roadmap',''),
	(148201899,'Congratulations ,This website is a default website setup for TYPO3. You can use it to demonstrate the basic features of the TYPO3 Content Management System, but you are also welcome to use it as a basis for your own website projects. Please have a look at how it works and how it is structured. In building this package, we have tried to combine a lot of best practices. Feel free to use these structures and use elements of it for your own way of working. , typo3, introduction package, install, example setup Possibilities    With a rich core feature set out-of-the-box, TYPO3 is an ideal choice for building ambitious digital experiences.   Features   Customizing                        Examples    Don\'t hesitate and discover the large selection of our pre-configured page layouts and content elements.   Pages   Content                          Playground    Build any web application you can imagine. Explore the Backend and experience the enormous flexibility.   Log into TYPO3                                    Deliver business value    Start small and scale as you grow with TYPO3 CMS. Your initial, simple TYPO3 website will keep pace with you as your needs grow. It offers powerful multilingual and multisite features to help you reach a global audience and create new websites with ease. TYPO3 provides proven return on investment with stable long-term installations and clean upgrade paths, while remaining flexible enough to support innovation.',''),
