	(244852572,'Customize   More than 6.000 extensions like News or Grid Elements expand the TYPO3 base functionality. Published by world-class developers around the world. And your independence? Guaranteed by 1.800 agencies. Thus keeps your CMS flexible and your investments save.                            6.000 Extensions and Counting    TYPO3 is an extremely modular system that can be easily enhanced with custom extensions. All TYPO3 sites are built on top of the TYPO3 core, which contains the systems fundamental functionality. Custom extensions interact with the core through the stable, clearly documented extension API. While the TYPO3 core does change in each new release, the interfaces between extensions and the core do not, ensuring easy updates and future-proof development.  TYPO3 relies on the TYPO3 extension manager - included in the TYPO3 core - for installing, activating, and deactivating extensions on a given TYPO3 installation. Extensions can be quickly imported and installed with just a couple clicks in the TYPO3 Admin Interface.     Packagist    TYPO3 Extension Repository                                   Extbase: TYPO3&#039;s Built-in MVC Framework    Recent versions of TYPO3 CMS include a built-in Model-View-Controller (MVC) framework called Extbase, which allows developers to take advantage of this popular programming design pattern.  Extbase a nice Domain-Driven-Design (DDD) approach for persisting DB records, as well as an action-controller based structure, which can be used for dynamic plugins in any frontend page, as well as custom Backend modules in TYPO3 itself. In fact, most of the default backend modules run with Extbase.  Extbase is a backport of features from TYPO3 FLOW to TYPO3 CMS.                              Fluid: Next Generation Templating    Fluid - TYPO3\'s next generation templating engine - is used for creating custom extension templates.  Fluid was created for TYPO3 Flow and has been backported to TYPO3 CMS.  Fluid\'s approach to creating templates emphasizes simplicity, flexibility, extensibility, and easy of use. The syntax is XML-based and can be extended in any Web IDE. With its ViewHelpers, Fluid can be extended by powerful functionality that fits custom web project needs.  Fluid is used with Extbase by default, and can be used standalone in other PHP functions and has its own TypoScript Content Object \"FLUIDTEMPLATE\".            Extensive Configuration Options    Nearly every aspect of the TYPO3 backend is configurable and customizable. Backend interfaces can often be configured using TSConfig. Nearly all rendered HTML content can be configured using TypoScript or Fluid, a PHP template engine, developed independently of TYPO3. Checkout our documentation linked below.    Fluid    TypoScript    TSConfig    TCA    Core API',''),
	(245513723,'Features   A single TYPO3 CMS installation can easily power hundreds of websites in many dozens of languages. Need more functionality? No problem! More than 1,500 open source extensions are available via Packagist and TYPO3 Extension Repository (TER).                                \n                                \n\n    \n            \n                                    Multisite\n                                \n        \n\n\n                              A single TYPO3 CMS installation can power multiple sites, efficiently sharing configuration, templates, branding, and content where needed. Point multiple domains to different entry points of your TYPO3 multisite installation.        \n                                \n\n    \n            \n                                    Multilingual\n                                \n        \n\n\n                              Deploy your content (or localised copies of your website in a multisite installation) in 56 languages. TYPO3 CMS websites and multisite installations support a variety of translation and localisation models and workflows.        \n                                \n\n    \n            \n                                    Any data, any source\n                                \n        \n\n\n                              The TYPO3 CMS file system abstraction layer can use and combine any number of file storage systems and locations while remaining completely transparent to editors. Existing file service integrations include Akamai, Alfresco, SixOMC, Cumulus, QBank DAM, Dropbox, Magento, Bynder, and Amazon S3.        \n                                \n\n    \n            \n                                    Mobile apps, responsive sites\n                                \n        \n\n\n                              Use TYPO3 CMS as the content management, business logic, and content provider for native mobile applications and front-end frameworks, as well as fully-responsive websites for website visitors and admins.        \n                                \n\n    \n            \n                                    Content history and auditing\n                                \n        \n\n\n                              TYPO3 CMS keeps a full, unlimited, auditable history of content publication and revision. Browse all changes in a visual data comparison via “diff” and selectively undo, or even undelete!        \n                                \n\n    \n            \n                                    On-page Search Engine Optimization (SEO)\n                                \n        \n\n\n                              A major part of getting on-page SEO right is consistency. With TYPO3 you can optimize for search engines on the go as you create individual pages with features like URL structure, page titles, and headers. It also allows you to quickly add your own meta description and meta tags.              Full Responsive Backend    The administration interface, called TYPO3 Backend, can be managed from any modern web browser, including tablets and smart phones the same way. Publishing a small change on-the-go or working with tablet devices to add content has never been easier.                                Runs everywhere    You can install TYPO3 by downloading  with or without composer . Putting it on a web server or on a cloud service like Microsoft Azure or Amazon AWS is simple - due to proper separation of content, configuration and other assets like caches and temporary files. Use any database you like MySQL/MariaDB, postgreSQL, SQL Server or SQLite - due to the underlying database abstraction.   Read TYPO3 Install Guide            Reliable Upgrade Paths    From its inception TYPO3 has emphasized the importance of stable APIs and full backwards-compatibility.  The TYPO3 core team follows a regular release schedule and take great care to ensure easy, non-breaking updates.   TYPO3 CMS Roadmap',''),
